gJI(){return"About"},
gJJ(){return"I am someone who likes to be curious \u2013 take a new course, learn a new sport, play a new instrument. For some reason it doesn\u2019t stop there; it needs to be as weird as possible. If I have heard of something, or know someone else has it, I become uninterested. From the purple jackets I wear, to the songs I listen to, to the software I like to make; It all needs to be exciting, unique, and done the right way, otherwise why bother. I am an avid pianist, traveler, kiteboarder, SCUBA diver, backcountry alpine skier, mountain climber, and anything else I can get my hands on. I speak Spanish for the most part \u2013 mainly to find new food to try. I love new things, but still somehow love coming back to my routine, my home, my friends, and my family.\n\nI don\u2019t believe that my intelligence or talent have been instrumental bringing me to where I am today. For me, it\u2019s my curiosity that compels me to push forward. While I may have the ability to do the research and write a thorough paper on Stalinism, my curiosity implores me to do something a bit more captivating. No offence meant toward anyone who has spent their life on Stalinism, but personally, I would rather rake cut grass into three perfect piles. In recent time, software engineers are no longer scarce, but anyone can build a website. My need for an answer forces me to be more inventive and have more fun. Given the time, curiosity will create something far more interesting than raw skill (not that I\u2019m completely lacking in that area). This page is the perfect example of my point. While yes, I could have made the same personal site that everyone does, I find that boring and uninteresting. Quite frankly, I don\u2019t think I could even finish one \u2013 I would probably end up fading away into something a bit more exciting, like lunch."},
gLy(){return"Experience"},
gLD(){return"Graduate Software Engineer | Sep 2023 - Present"},
gLE(){return"\u2022 Full stack agile development in Java, Flutter, Python, Svelte, and SQL\n\u2022 Designed, developed, and delivered major sections of VisaGO - the first direct-to-consumer facing Visa app with digital issuance and the first to achieve over 150,000 downloads within 90 days\n\u2022 Integrated with ChatGPT on multiple internal projects to speed up other teams\u2019 workflows"},
gLz(){return"Software Engineering Intern | May 2022 - Aug 2022"},
gLA(){return"\u2022 Designed & delivered a GUI in C++ for running scripts in a flight simulator, including XML customization\n\u2022 Tested cockpit emulators and software integration on Learjets, Gulfstreams, and the X-62 fighter jet"},
gLB(){return"Junior Software Developer | Jun 2020 - May 2022"},
gLC(){return"\u2022 Worked closely with Senior Developers to develop front end modules in current production release\n\u2022 Shipped PHP, HTML, and CSS features, and tested web applications locally and through TestFlight"},
gNI(){return"Projects"},
gNF(){return"The Kite Calculator"},
gNE(){return"The kite calculator is a passion project of mine. I am an avid kiteboarder, windsurfer, and sailor. Where kiteboarding and windsurfing differ from sailing, is that depending on the wind, sailors can raise or lower their sail, changing the amount of surface area so they are never overpowered. Kites and windsurfers come in one size that cannot be changed, so you will need to buy another of a different size to sail in different weather. Given the unexpected nature of weather, in order to kite or windsurf anywhere regularly, you will need at least 2 or three sizes. This uncertainty is where this site comes into use. Given the rider\u2019s weight and the current wind speed, it can give you a recommended kite size in m2. In the future, I would like to expand this to include windsurfing, kite foiling, and wing foiling, but for now, enjoy the water!"},
gNH(){return"Virtual Dive Simulator"},
gNG(){return"Virtual reality provides an escape from everyday life. It allows users to experience an artificial environment that they may otherwise never see. VR is not just used for entertainment; it has very real practical and educational applications. This project seeks to use virtual reality to teach users some of the basics of scuba diving. By reducing the barrier to entry, it will make diving more accessible, and hopefully spread interest in it. The final artifact is a scuba diving simulator that will show how applicable VR is as a teaching method.\n\nThis scuba diving simulator uses aspects from real diving courses to make it more realistic. It uses virtual gauges based off real dive instruments and encourages the users to learn their functionality through trial and error. Teaching a subject through virtual reality makes it more like a game. This change of point of view can help users engage with the teaching and absorb more information.\n\nParticipants in the simulator\u2019s user study agreed that this simulator would encourage environmental awareness despite not having a large focus on the topic. By getting more people interested in diving, the simulator could help to spread involvement in ocean conservation. Most participants were able to learn more about the subject and found the experience immersive and informative. The project provides a great basis for expansion into other aspects of diving or even different subjects. It could also be integrated with various dive courses to help improve and streamline the learning process."},
